import React from 'react'


const Navbar = ({filteritem, menuList}) => {
  return (
    <div>
    <nav className='navbar'>
    <div className='btn-group'>

    {
        menuList.map(()=>{

            <button className='btn-group__item' onClick={()=>filteritem("breakfast")}>
               Breakfast
            </button>

        })
    }
    
    </div>
  </nav>
    </div>
  )
}

export default Navbar


